import React from 'react';
// import PropTypes from 'prop-types';
import fixed from '../../Functions/fixed';

function Information({ coininf, handleCoinSubmit }) {
  const {
    name, symbol, priceUsd, marketCapUsd, vwap24Hr, supply, maxSupply, volumeUsd24Hr,
    changePercent24Hr,
  } = coininf;

  return (
    <div className="container">
      <div className="row py-3 align-items-center">
        <div className="col-lg col-sm">
          <div>
            {name}
          </div>
          <div>
            {symbol}
          </div>
        </div>
        <div className="col-lg col-sm">
          priceUsd: $
          {fixed(priceUsd)}
        </div>
        <div className="col-lg col-sm">
          <input type="text" />
          <button onClick={handleCoinSubmit}>Add</button>
        </div>
      </div>
      <div className="row py-3">
        <div className="col-lg col-sm">
          marketCapUsd: $
          {fixed(marketCapUsd)}
        </div>
        <div className="col-lg col-sm">
          vwap24Hr: $
          {fixed(vwap24Hr)}
        </div>
        <div className="col-lg col-sm">
          supply: $
          {fixed(supply)}
        </div>
      </div>
      <div className="row py-3">
        <div className="col-lg col-sm">
          maxSupply: $
          {fixed(maxSupply)}
        </div>
        <div className="col-lg col-sm">
          olumeUsd24Hr: $
          {fixed(volumeUsd24Hr)}
        </div>
        <div className="col-lg col-sm">
          changePercent24Hr:
          {' '}
          {fixed(changePercent24Hr)}
          %
        </div>
      </div>
    </div>
  );
}

// Information.propTypes = {
//   handleCoinSubmit: PropTypes.func.isRequired,
// };

export default Information;
